import React from 'react';
import './style.css';
import thumbDown from './images/thumb-down.svg';
import thumbUp from './images/thumb-up.svg';

const LikeDislike = ({ downRate, upRate, onLike, onDislike, hasClicked }) => {
  return (
    <div className="rate">
      <div className="item">
        <button onClick={onDislike} disabled={hasClicked}>
          <img src={thumbDown} alt="Thumb Down" />
          <p>{downRate}</p>
        </button>
      </div>
      <div className="item">
        <button onClick={onLike} disabled={hasClicked}>
          <img src={thumbUp} alt="Thumb Up" />
          <p>{upRate}</p>
        </button>
      </div>
    </div>
  );
};

export default LikeDislike;
